import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div class="conatiner">
        <Container>
  <Navbar expand="lg" variant="light" bg="light">
    <Container>
      <Navbar.Brand href="#">Navbar</Navbar.Brand>
    </Container>
  </Navbar>
</Container>
        <h1>Hello World!</h1>
        </div>
      </header>
    </div>
  );
}

export default App;
